import React from "react";
import TopHeading from "./Heading1";
import Heading from "./Heading2";
import Page from "./Page"
import Table from "./Table";
import { SuggestedInput } from "./Suggest";

function App(){
    return <div>
        <TopHeading />
        <Heading />
        <Page />
        <SuggestedInput />
        <Table />
    </div>
}

export default App;
